import React, { useState, useEffect } from "react";
import axios from "axios";
import "../assets/table3.css";

const Table3 = ({ apiData2 }) => {
  const [data, setApiData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          process.env.REACT_APP_HOST + "/api/ping/check-cctv2"
        );
        setApiData(response.data.data); // Set data to response.data.data
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <table className="table5">
        <thead>
          <tr>
            {data &&
              data.map((item) => (
                <th key={item.ip} style={{ writingMode: "vertical-lr" }}>
                  {item.name}
                </th>
              ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            {data && 
            data.map((name) => (
              <td key={item.name}>
                 <table className="table6">
                 <tbody>
  {data.map((name, index) => (
    <tr key={index}>
      <td
        className={`status-cell ${name.status === "ON" ? "status-on" : "status-off"}`}
        title={name.ip}
        onClick={() => window.open(`http://${name.ip}`, "_blank")}
        style={{ cursor: "pointer" }}
      >
        <div>{index + 1}</div>
      </td>
    </tr>
  ))}
</tbody>
              </table>
              </td>
            ))}
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Table3;
